import React from 'react';
import './Inicio.css';
import { Link } from 'react-router-dom';

function Inicio() {
  return (
    <div>
      <div className="carousel">
        <img src="link_para_imagem1.jpg" alt="Imagem 1" />
        <img src="link_para_imagem2.jpg" alt="Imagem 2" />
        <img src="link_para_imagem3.jpg" alt="Imagem 3" />
      </div>

      <section className="section">
        <h2>Aluguel de Ônibus</h2>
        <img src="link_para_imagem.jpg" alt="Aluguel de Ônibus" />
        <Link to="/alugueldeonibus" className="section-link">
          Saiba Mais
        </Link>
      </section>

      {/* Outras seções... */}
    </div>
  );
}

export default Inicio;
